DROP TABLE IF EXISTS all_urls;
CREATE TABLE all_urls
(
    package_hash text not null,
    vendor       text,
    component    text,
    version      text,
    date         text,
    url          text not null,
    url_hash     text not null,
    mine_id      integer,
    license      text,
    version_id   integer,
    license_id   integer,
    purl_name    text,
    primary key (package_hash, url, url_hash)
);





